import{_ as e,o,c as t,O as a}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 32.1-162.21 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/32.1-162.21.md","filePath":"vacode/32.1-162.21.md"}'),n={name:"vacode/32.1-162.21.md"},r=a('<h1 id="§-32-1-162-21-definitions" tabindex="-1">§ 32.1-162.21 Definitions. <a class="header-anchor" href="#§-32-1-162-21-definitions" aria-label="Permalink to &quot;§ 32.1-162.21 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context clearly requires another meaning:</p><p>&quot;Cloning&quot; means the production of a precise genetic copy of a molecule, including deoxyribonucleic acid (DNA), or of chromosomes.</p><p>&quot;Human cloning&quot; means the creation of or attempt to create a human being by transferring the nucleus from a human cell from whatever source into an oocyte from which the nucleus has been removed.</p><p>&quot;Nucleus&quot; means the cell structure that houses the chromosomes and, thus, the genes.</p><p>&quot;Oocyte&quot; means the ovum or egg.</p><p>&quot;Somatic cell&quot; means a mature, diploid cell, i.e., a cell having a complete set of chromosomes.</p><p>&quot;Somatic cell nuclear transfer&quot; means transferring the nucleus of a somatic cell of an existing or deceased human into an oocyte from which the chromosomes are removed or rendered inert.</p><p>2001, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0868" target="_blank" rel="noreferrer">868</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0870" target="_blank" rel="noreferrer">870</a>.</p>',9),i=[r];function c(s,l,u,h,m,p){return o(),t("div",null,i)}const _=e(n,[["render",c]]);export{f as __pageData,_ as default};
